import React, {useContext} from 'react';
import {PlanetsContext} from '../../context/PlanetsContext.js'; 
import Planet from './Planet.js';

const PlanetsDisplay = () => {

	const {planetsTab, dispatch} = useContext(PlanetsContext);

	const planets = (

		planetsTab.map((planet, index) => (
			<Planet key={planet.number} planet={planet} index={index}/>
			)
		)
	);
	return (
		<div>
			{planets}		
		</div>
	)
};
export default PlanetsDisplay
